                  ></i>
                </a>
              </li>
              <li>
                <a href='#'>
                  <i
                    className='fa fa-user'
                    style={{
                      fontSize: 35,
                      color: "grey",
                      marginLeft: -36,
                      paddingBottom: 60
                    }}
                  ></i>
                </a>
              </li>
              <li>
                <a href='#'>
                  <i
                    className='fa fa-phone'
                    style={{
                      fontSize: 35,
                      color: "grey",
                      marginLeft: -36,
                      paddingBottom: 60
                    }}
                  ></i>
                </a>
              </li>
              <li>
                <a href='#'>
                  <i
                    className='fa fa-cog'
                    style={{
                      fontSize: 35,
                      color: "grey",
                      marginLeft: -36,
                      paddingBottom: 60
                    }}
                  ></i>
                </a>
              </li>
            </ul>
          </div>
          <div
            style={{
              height: 1000,
              width: "100%",
              //float: "left",
              //position: "relative"
              background: "#f5f5f5",
              marginLeft: 100
            }}
          >
            <Container>
              <Row
                style={{
                  //inside the dashboard
                  marginTop: 150
                }}
              >
                <Col md={12}>
                  <h2 style={{ color: "#222222", textAlign: "left" }}>
                    Project Title Holder
                  </h2>
                </Col>
              </Row>
              <Row
                style={{
                  //inside the dashboard
                  marginTop: 20
                }}
              >
                <Col md={1}>
                  <Button className='circleButton'>
                    <i className='fa fa-pen'></i>
                  </Button>
                </Col>
                <Col md={3}>
                  <Button variant='primary'>Primary</Button>
                </Col>
                <Col md={3}>
                  <Button variant='primary'>Primary2</Button>
                </Col>
                <Col md={5}></Col>
              </Row>
              <Row
                style={{
                  //inside the dashboard
                  marginTop: 50
                }}
              >
                <Col md={3}>
                  <div
                    style={{
                      backgroundColor: "#ffffff",
