                      width: "100%",
                      borderRadius: 5
                    }}
                  >
                    <p>hi</p>
                  </div>
                </Col>
              </Row>
              <Row
                style={{
                  //inside the dashboard
                  marginTop: 50
                }}
              >
                <Col md={6}>
                  <div
                    style={{
                      backgroundColor: "#ffffff",
                      height: 300,
                      width: "100%",
                      borderRadius: 5
                    }}
                  >
                    <p>hi</p>
                  </div>
                </Col>
                <Col md={6}>
                  <div
